package ma.example.moviesselector;

import androidx.annotation.NonNull;
import androidx.appcompat.app.AppCompatActivity;
import androidx.core.view.MenuItemCompat;
import androidx.recyclerview.widget.ItemTouchHelper;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import android.os.Bundle;
import android.util.Log;
import android.view.Menu;
import android.view.MenuItem;
import android.widget.SearchView;
import android.widget.Toast;

import java.util.ArrayList;
import java.util.List;

import adapters.TvshowAdapter;
import beans.Tvshow;
import services.TvshowService;

public class ListActivity extends AppCompatActivity {

    private List<Tvshow> tvshows = new ArrayList<>();
    private RecyclerView recyclerView;
    private adapters.TvshowAdapter tvshowAdapter = null;
    private TvshowService service;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_list);
        service = TvshowService.getInstance();
        init();
        recyclerView = findViewById(R.id.recycle_view);
        tvshows = service.findAll();
        tvshowAdapter = new TvshowAdapter(this, tvshows);

        recyclerView.setAdapter(tvshowAdapter);
        recyclerView.setLayoutManager(new LinearLayoutManager(this));

        ItemTouchHelper.SimpleCallback itemTouchHelperCallback = new ItemTouchHelper.SimpleCallback(0, ItemTouchHelper.RIGHT) {
            @Override
            public boolean onMove(@NonNull RecyclerView recyclerView, @NonNull RecyclerView.ViewHolder viewHolder, @NonNull RecyclerView.ViewHolder target) {
                return false;
            }

            @Override
            public void onSwiped(@NonNull RecyclerView.ViewHolder viewHolder, int direction) {
                int position = viewHolder.getAdapterPosition();
                tvshows.remove(position);
                tvshowAdapter.notifyItemRemoved(position);
            }
        };
        ItemTouchHelper itemTouchHelper = new ItemTouchHelper(itemTouchHelperCallback);
        itemTouchHelper.attachToRecyclerView(recyclerView);
    }

    public boolean onCreateOptionsMenu(Menu menu) {
        getMenuInflater().inflate(R.menu.menu,menu);
        MenuItem menuItem = menu.findItem(R.id.app_bar_search);
        SearchView searchView = (SearchView) MenuItemCompat.getActionView(menuItem);

        searchView.setOnQueryTextListener(new SearchView.OnQueryTextListener() {
            @Override
            public boolean onQueryTextSubmit(String query) {
                return true;
            }
            @Override
            public boolean onQueryTextChange(String newText) {

                if (tvshowAdapter != null){
                    tvshowAdapter.getFilter().filter(newText);
                }
                return true;
            }
        });
        return true;
    }


    public void init(){
        service.create(new Tvshow("data:image/jpeg;base64,", "Game of Thrones", "historic", "", 1));
        service.create(new Tvshow("data:image/jpeg;base64,", "Vikings", "historique", "", 4));
        service.create(new Tvshow("data:image/jpeg;base64,", "Peacky Blinders", "", "", 3));
        service.create(new Tvshow("data:image/jpeg;base64,", "Prison Break", "", "", 4));
        service.create(new Tvshow("data:image/jpeg;base64,", "Breacking Bad", "", "", 3));
        service.create(new Tvshow("data:image/jpeg;base64,", "The Walking Dead", "", "", 2));
        service.create(new Tvshow("data:image/jpeg;base64,", "Lucifer", "", "", 1));
    }
}